import { Button } from 'react-bootstrap';
import Card from 'react-bootstrap/Card';
import { Link } from 'react-router-dom';


export default function Bebida(props) {
    return (
        <Card className="card-bebida">
            <Card.Img variant="top" src={props.bebida.imagen} />
            <Card.Body>
                <Card.Title>{props.bebida.titulo}</Card.Title>
                {/* <span>{props.meme.publishedAt}</span> */}
                <p>{props.bebida.precio}</p>

            </Card.Body>

            <Button as={Link} to={`/bebida/${props.bebida.id}`}>
                detalle
            </Button>
        </Card>
    );
}
